import React from "react";
import distanceInWordsToNow from "date-fns/distanceInWordsToNow";

import { Message } from "components";

import "./Home.scss";

const Auth = () => (
  <section className="home">
    <Message
      avatar="https://images.pexels.com/photos/443446/pexels-photo-443446.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
      text="Hello"
      date="Sun Dec 22 2019 00:03:14 GMT+0200"
    />
  </section>
);

export default Auth;
